import React from 'react';
import { ChakraProvider } from '@chakra-ui/react';
import { ArrowForwardIcon } from '@chakra-ui/icons'
import ReactDOM from 'react-dom';
import './index.css';
import Header from './Header';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <ChakraProvider>
      <Header />
      <App />
    </ChakraProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
